import React, {useState,useEffect} from 'react';
import * as Actions from "../actions";
import {connect} from 'react-redux';
import {Dashboard,Topbar,Categories} from '../containers';
import {getProfileUser} from "../tools/handleRequests"


const DashboardRoute = ({user}) => {
    useEffect(() => {
        console.log(getProfileUser());
    }, [])
    return (
        <Dashboard>
            <Topbar></Topbar>
            <Categories></Categories>
        </Dashboard>
    )
}
export default connect(state => ({user: state.user}))(DashboardRoute)
